import {BrowserRouter as Router, Route, Link} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css" ;
function App() {
  return (
    <Router>
   <div className="container">
<h2>Mern stack todo app</h2>
   </div>
   <Route path="/" exact Componenet={TodosList}></Route>
   <Route path="/edit/:id" exact Componenet={EditTodo}></Route>
   <Route path="/Create" exact Componenet={CreateTodo}></Route>
   </Router>
  );
}

export default App;
